import React from 'react';
import classes from './NavBar.module.css';
//let classes {
//   'nav': 'nav'
  // 'item': 'item'
//}
const NavBar = () => {
 return <nav className= {classes.nav}>
 <div className={classes.item}>
     <a> Profile </a>
     </div>
 <div className={classes.item}> 
 <a>Messages</a>
  </div>
 <div className={classes.item}>
     <a> News </a>
      </div>
 <div className={classes.item}>
     <a>Setting </a>
     </div>

</nav>
      
}

export default NavBar;
